import React from "react";

const Footer = () => {
  const footerStyles = {
    footer: {
      width: "1440px",
      margin: "0 auto",
      background: "#f8f5f0",
      padding: "20px 0",
      textAlign: "center",
      position: "relative",
    },
    footerContent: {
      display: "flex",
      justifyContent: "space-around",
      alignItems: "center",
      flexWrap: "wrap",
      color: "#333333",
      fontFamily: "Arial, sans-serif",
    },
    footerSection: {
      flex: 1,
      minWidth: "200px",
      margin: "10px",
    },
    footerHeading: {
      fontSize: "18px",
      marginBottom: "10px",
    },
    footerList: {
      listStyle: "none",
      padding: 0,
    },
    footerLink: {
      textDecoration: "none",
      color: "#333333",
    },
  };

  return (
    <div style={footerStyles.footer}>
      <div style={footerStyles.footerContent}>
        <div style={footerStyles.footerSection}>
          <h4 style={footerStyles.footerHeading}>About Us</h4>
          <p>
            Learn more about our mission, values, and the team behind our
            platform.
          </p>
        </div>
        <div style={footerStyles.footerSection}>
          <h4 style={footerStyles.footerHeading}>Quick Links</h4>
          <ul style={footerStyles.footerList}>
            <li>
              <a href="#home" style={footerStyles.footerLink}>
                Home
              </a>
            </li>
            <li>
              <a href="#services" style={footerStyles.footerLink}>
                Services
              </a>
            </li>
            <li>
              <a href="#contact" style={footerStyles.footerLink}>
                Contact
              </a>
            </li>
          </ul>
        </div>
        <div style={footerStyles.footerSection}>
          <h4 style={footerStyles.footerHeading}>Follow Us</h4>
          <p>
            <a href="https://facebook.com" style={footerStyles.footerLink}>
              Facebook
            </a>{" "}
            |{" "}
            <a href="https://twitter.com" style={footerStyles.footerLink}>
              Twitter
            </a>{" "}
            |{" "}
            <a href="https://instagram.com" style={footerStyles.footerLink}>
              Instagram
            </a>
          </p>
        </div>
      </div>
    </div>
  );
};

export default Footer;
